VALUES ('3166350006295', 'Poulet Sauce Moutarde, Riz Cuisiné', 'Émincés de poulet sauce moutarde 57 % : émincés de poulet marinés et cuits 27,5 % (viande de poulet 27 %, sel, sucre, jus de citron), eau, _crème_ fraîche, _moutarde_ de Dijon 3 % (eau, graines de _moutarde_, vinaigre d\'alcool, sel), échalotes, vin blanc, farine de _blé_, _moutarde_ à l\'ancienne 0,9 % (eau, graines de _moutarde_, vinaigre d\'alcool, sel, vinaigre de vin, sucre, épices), vinaigre d\'alcool, huile de colza, poivre, extrait d\'épice, curcuma. Duo de riz cuisiné 43 % : riz cuit 30 %, oignons, riz sauvage cuit 2,2 %, huile de colza, fond de volaille (amidon de maïs, graisse de poulet, sel, poulet, jaune d\'_œuf_, oignon, _lait_ écrémé en poudre, _céleri_, herbes et épices), thym, poivre, laurier.', 'https://static.openfoodfacts.org/images/products/316/635/000/6295/front_fr.7.400.jpg', '5.7', '1.7', '16.1', '0.6', '0.8', '8.9', '0.67', '0.263779527559055', '', '1');

