VALUES ('3166352940054', 'Tagliatelles au Poulet, Champignons, Crème', 'Tagliatelles cuites 34,3% (eau, semoule de blé dur, œufs, huile de colza, persil), poulet traité en salaison 21,6% (viande de poulet origine UE ou hors UE 19,8%, eau, amidon, sel), eau, crème fraîche légère 6% (contient lait), champignons de Paris 4,3% (champignons, eau, sel), carottes 3,1%, carottes jaunes 2,8%, petits pois 2,3%, courgettes 2,2%, amidon de maïs, échalotes, farine de blé, ciboulette 0,4%, arômes naturels (contient œuf, blé, céleri),sel, poivre.', 'https://static.openfoodfacts.org/images/products/316/635/294/0054/front_fr.63.400.jpg', '2.4', '0.9', '12', '1', '0.9', '7.9', '0.71', '0.279527559055118', '', '1');

